drop table if exists BEACONS;

drop table if exists MAPAS;

drop table if exists LOGIN;

create table BEACONS
(
   ID_BEACON            int not null auto_increment  comment '',
   ID_MAPA              int not null  comment '',
   NOMBRE               varchar(50) not null  comment '',
   COOX                 int not null  comment '',
   COOY                 int not null  comment '',
   primary key (ID_BEACON)
);

create table LOGIN
(
   ID_LOGIN             int not null auto_increment  comment '',
   NOMBRE               varchar(50) not null  comment '',
   APELLIDO             varchar(50) not null  comment '',
   NOM_USU              varchar(50) not null  comment '',
   CONTRASENIA          varchar(50) not null  comment '',
   CORREO          		varchar(50) not null  comment '',
   primary key (ID_LOGIN)
);

create table MAPAS
(
   ID_MAPA              int not null auto_increment  comment '',
   ID_LOGIN             int not null  comment '',
   MAPA                 longblob not null  comment '',
   PISO                 varchar(3) not null  comment '',
   OBJETO               longtext not null  comment '',
   primary key (ID_MAPA)
);

alter table BEACONS add constraint FK_BEACONS_RELATIONS_MAPAS foreign key (ID_MAPA)
      references MAPAS (ID_MAPA);

alter table MAPAS add constraint FK_MAPAS_RELATIONS_LOGIN foreign key (ID_LOGIN)
      references LOGIN (ID_LOGIN);
	  
